import './App.css';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';

//importamos los comp creados
import ListarOrdenes from './components/listarOrdenes';
import Home from './components/home';
import NavBarExample from './layouts/navbar';
import Login from './components/login';
import CrearOrdenes from './components/crearOrdenes';


function App() {
  return (
    <div className="App">

<BrowserRouter>
  <Routes>
    <Route path='/' element={ <NavBarExample /> }>
      <Route path='ListarOrdenes' element={ <ListarOrdenes /> } />
      <Route path='CrearOrdenes' element={ <CrearOrdenes /> } />
      <Route path='Login' element={ <Login /> } />
      <Route path='*' element={ <Navigate replace to="/"/> }/>
    </Route>

  </Routes> 

</BrowserRouter>

<Home>
        titulo1='Información de los paguetes'
        titulo2='Servicio'
        titulo3='Quienes somos'
        titulo4='Contactanos'
        texto1='Te brindamos el mejor servicio para tus envios.'
        texto3='Con mas 10 años en el mercado, haciendo felices a nuestros clientes.'
        texto4='Siguenos en nuestras redes sociales o manda tus datos a nuestros correos.'
  </Home>

    </div>
  );
}

export default App;
